import React from "react";
import "./Header.css";


const Header = () => {
  return (
    <header className="header-container">
      <nav>
        <ul>
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">Bulletin Board</a>
          </li>
          <li>
            <a href="#">Calendar</a>
          </li>
          <li>
            <a href="#">Finances</a>
          </li>
          <li>
            <a href="#">Group Members</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
